import { BrowserRouter, Route, Routes } from "react-router-dom";
import Home from "./component/movie_list/page/Home";
import Header from "./Header";

function App() {
  return (
    <BrowserRouter>
      <Header />
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
